import React, { useEffect, useContext } from "react";
import { Typography, Button, Input, TextField } from "@material-ui/core";
import axios from "axios";

import { Context } from "../Context";
import Navbar from "../Navbar";
import useStyles from "../styles";
import { Container } from "@material-ui/core";
import { FormGroup } from "@material-ui/core";

function EditAccount() {

  const {
    accountState,
    getAccountInfo
  } = useContext(Context);

  // All possible account info categories for 3 types of users
  const {
    acc_id,
    branch_id,
    employee_id,
    email,
    username,
    first_name,
    last_name,
    hp,
    mgr_id,
    role_id,
    store_id,
    type_id,
  } = accountState;

  useEffect(() => {
    getAccountInfo();
  }, []);

  return (
    <main>
      <Typography h3>Change Account Information</Typography>
      <TextField label="User Name">New Username: </TextField>
      <TextField label="First Name">New Username: </TextField>
      <TextField label="Last Name">New Username: </TextField>
    </main>
  )
}

export default EditAccount;
